&nbsp;<a href="/s/-%E6%96%87%E6%9D%BE------------/" target="_blank">文松</a>&nbsp;<a href="/s/-%E8%B4%BE%E5%86%B0------------/" target="_blank">贾冰</a>&nbsp;<a href="/s/-%E6%9B%B9%E5%BE%81------------/" target="_blank">曹征</a>&nbsp;<a href="/s/-%E8%92%8B%E6%A2%A6%E5%A9%95------------/" target="_blank">蒋梦婕</a>&nbsp;<a href="/s/-%E6%9E%97%E5%BF%97%E7%8E%B2------------/" target="_blank">林志玲</a>&nbsp;<a href="/s/-%E5%AE%8B%E5%B0%8F%E5%AE%9D------------/" target="_blank">宋小宝</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/3/" target="_blank">综艺</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　　北京卫视猪年春晚依然主打跨界风，杨幂、蔡徐坤将携手带来由蔡徐坤为晚会原创的新歌《那年春天》；“猪八戒”马德华将与人气组合乐华七子同台载歌载舞；刘涛、王凯演绎歌曲《爱江山更爱美人》；姚晨、秦海璐带来耳熟能详的歌曲《红豆》；唐嫣、罗晋夫妇与凤凰传奇联袂挑战神曲；杨紫、许魏洲、关晓彤、韩东君将合作带来</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/70658/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/68501/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-01-28/201901281548687178.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">7.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/68501/">功夫奇葩闯北京</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E7%9F%B3%E9%98%BF%E5%A5%87------------/" target="_blank">石阿奇</a>&nbsp;<a href="/s/-%E9%9F%A9%E9%87%91%E5%A7%97------------/" target="_blank">韩金姗</a>&nbsp;<a href="/s/-%E5%85%B3%E4%BF%8A%E6%9D%B0------------/" target="_blank">关俊杰</a>&nbsp;<a href="/s/-%E5%8D%A2%E5%BF%83%E5%B8%8C------------/" target="_blank">卢心希</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E7%9F%B3%E9%98%BF%E5%A5%87--------/" target="_blank">石阿奇</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/6/" target="_blank">动作片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2015/" target="_blank">2015</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>土豆，从老家农村，到城里已经3年时间了，怀着梦想进城打拼，进城目标就是在城里，有车有房有女人好兄弟阿龙功夫了得，是一个习武的天才，觉得在老家没有用武之地。听村里人说，一起长大的哥们土豆，在城里赚了好多的钱。阿龙就带上行李来到城市里，找到了好兄弟土豆，就这样两个农村小伙，大闹京城，也在寻找梦想。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/68501/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-ma