s="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/14887/">我来自北京</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%91%A8%E5%BC%98------------/" target="_blank">周弘</a>&nbsp;<a href="/s/-%E9%99%88%E5%AE%9D%E8%8E%B2------------/" target="_blank">陈宝莲</a>&nbsp;<a href="/s/-%E6%AC%A7%E7%91%9E%E4%BC%9F------------/" target="_blank">欧瑞伟</a>&nbsp;<a href="/s/-%E4%BD%95%E8%8B%B1%E4%BC%9F------------/" target="_blank">何英伟</a>&nbsp;<a href="/s/-%E7%BD%97%E6%B6%A6%E5%B9%B3------------/" target="_blank">罗润平</a>&nbsp;<a href="/s/-%E9%BB%84%E7%B4%A0%E6%AC%A2------------/" target="_blank">黄素欢</a>&nbsp;<a href="/s/-%E7%A8%8B%E4%B8%9C------------/" target="_blank">程东</a>&nbsp;<a href="/s/-%E6%A2%81%E5%85%8B%E9%80%8A------------/" target="_blank">梁克逊</a>&nbsp;<a href="/s/-%E6%A2%81%E9%94%A6%E7%87%8A------------/" target="_blank">梁锦燊</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%8E%E8%8B%B1%E6%B4%9B--------/" target="_blank">李英洛</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------1992/" target="_blank">1992</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>周弘持单程证从中国大陆来港，与同乡姐妹陈宝莲运用天赋本钱，颠倒众生，更挤身入名流社会，结识富商李某，将情欲贡献，【《愿望》短评：又是一部个男人与两个女人的故事，不多又邂逅英俊少年何英伟，单方情头意合，正准备婚礼时期，前度男友欧瑞伟忽然呈现，苦苦痴缠，致使这个来自中国的少女自苦海浮出求生，又坠入这茫茫</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/14887/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/26420/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2017-07-28/201707281501252819.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">3.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清国语中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/26420/">北京八年</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%A9%AC%E5%B8%85------------/" target="_blank">马帅</a>&nbsp;<a href="/s/-%E5%AD%99%E7%8E%89------------/" target="_blank">孙玉</a>&nbsp;<a href="/s/-%E9%92%9F%E5%8D%93%E8%A8%80------------/" target="_blank">钟卓言</a>&nbsp;<a href="/s/-%E6%9D%8E%E5%A4%8F%E4%BD%A9------------/" target="_blank">李夏佩</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%A8%E6%8C%AF--------/" target="_blank">杨振</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　　2006年大学毕业的董家强与好友夏冻梨二人怀揣梦想一同来到北京，投奔已在北京闯荡的好友张少华在经历数次创业失败之后，八年未曾归家的董家强意外得知家中早已发生变故，恍然觉悟，其实自己最该走的是归家之路。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/26420/">查看详情</a></dd></dl><div class="fed-page-info fed-text-center"><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href="/s/%E5%8C%97%E4%BA%AC------------/">首页</a><a class="fed-btns-info fed-rims-info" href="/s/%E5%8C%97%E4%BA%AC----------3---/">上页</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E5%8C%97%E4%BA%AC------------/">1</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-disad" href="javascript:;">...</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E5%8C%97%E4%BA%AC----------3---/">3</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-green" href="javascript:;">4</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E5%8C%97%E4%BA%AC----------5---/">5</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline fed-btns-disad" href="javascript:;">...</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-sm-inline" href="/s/%E5%8C%97%E4%BA%AC----------10---/">10</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href="javascript:;">4/10</a><a class="fed-btns-info fed-rims-info" href="/s/%E5%8C%97%E4%BA%AC----------5---/">下页</a><a class="fed-btns-info fed-rims-info fed-hide fed-show-xs-inline" href="/s/%E5%8C%97%E4%BA%AC----------10---/">尾页</a><input class="fed-rims-info" type="text" placeholder="输入页码" autocomplete="off"><a class="fed-btns-info fed-ri